import React, { useState } from 'react';
import './App.css'; // Si tienes un archivo CSS separado

const LoginPage = () => {
  const [isRegistering, setIsRegistering] = useState(false);

  const toggleForm = () => {
    setIsRegistering(!isRegistering);
  };

  return (
    <div className="login-page">
      <div className="form">
        {isRegistering ? (
          <form className="register-form">
            <input type="text" placeholder="name" />
            <input type="password" placeholder="password" />
            <input type="text" placeholder="email address" />
            <button type="submit">create</button>
            <p className="message">Already registered? <span onClick={toggleForm}>Sign In</span></p>
          </form>
        ) : (
          <form className="login-form">
            <input type="text" placeholder="username" />
            <input type="password" placeholder="password" />
            <button type="submit">login</button>
            <p className="message">Not registered? <span onClick={toggleForm}>Create an account</span></p>
          </form>
        )}
      </div>

      <style>
        {`
          .login-page {
            width: 360px;
            padding: 8% 0 0;
            margin: auto;
          }
          /* Resto del CSS aquí */
        `}
      </style>
    </div>
  );
};

export default LoginPage;
